import React from 'react';

const Button = ({onButtonSelection}) => {


	return(
		<div>
	<button onClick={ () => onButtonSelection('people')}>People</button>
	<button onClick={ () => onButtonSelection('vehicles')}>Vehicles</button>
		</div>
);
}

export default Button
